import React, {Component} from 'react'
import { API_BASE } from '../constants';
import { Rating, Image, Card } from 'semantic-ui-react'
import Logo from "../images/plant.svg"


class Profile extends Component {

	componentDidMount() {
		console.log(this.props.user)
	}

	render() {
		const {username, plant_care_rating, avatar} = this.props.user
		return (
			<div><br/>
				<Card>
					<Image src={avatar ? API_BASE+avatar.url : Logo } wrapped ui={false}  />
					<Card.Content><Card.header>{username}</Card.header></Card.Content>

				</Card>
			</div>
		)
	}
}

export default Profile
